import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Users from './components/users/users';
import Products from './components/products/products';

class App extends Component {
  render() {
    return (
      <div className="App">
      <div className="nav-bar"><h1>The Powerful</h1></div>
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <Users />
          <Products />
        </header>
        <div>
          <iframe width="100%" height="0" margin="0"  title="yt_1" src="https://www.youtube.com/embed/xPiprkwzEWU?autoplay=0" frameBorder="0" allow="autoplay; encrypted-media" allowFullScreen></iframe>
        </div>
        <div className="footer">
          <span className="fa fa-search col" aria-hidden="true"></span>
          <span className="fa fa-home col" aria-hidden="true"></span>
        </div>
      </div>
    );
  }
}

export default App;
